import React from 'react';
import { connect } from 'react-redux';
import { cambioIDioma } from './Redux/actions';
import styles from '../NavBar/NavBar.module.css';
import LogoJZNegro from '../../Assets/LogoJZNegro.png';

function Navbar() {
  return (
    <div className={styles.navbar}>
      
      <img className={styles.logo} src={LogoJZNegro} alt="logo" />
      
      <div className={styles.sections}>
        <ul>
          <li>Inicio</li>
          <li>Sobre m√≠</li>
          <li>Habilidades</li>
          <li>Proyectos</li>
          <li>Contacto</li>
        </ul>
      </div>
      <div className={styles.options}>
        <div>
          <label className={styles.switch}>
              <input type="checkbox"/>
              <span className={styles.slider}></span>
          </label>
        </div>
        <div className={styles.language}>
          <button onClick={() => cambioIDioma(false)}>ES</button>
          <button onClick={() => cambioIDioma(true)}>EN</button>
        </div>
      </div>
    </div>
  );
}

export default Navbar;
